class Solution {
  int findMinimumOperations(String s1, String s2, String s3) {
    // Initially, there are no operations performed.
    int operations = 0;

    // Find the shortest string's length to know the maximum possible common suffix length.
    int minLen = [s1.length, s2.length, s3.length].reduce((a, b) => a < b ? a : b);

    while (s1.isNotEmpty && s2.isNotEmpty && s3.isNotEmpty) {
      // If the last characters of all strings are the same, potentially they can be made equal,
      // so move to the next character by trimming the strings.
      if (s1[s1.length - 1] == s2[s2.length - 1] && s2[s2.length - 1] == s3[s3.length - 1]) {
        s1 = s1.substring(0, s1.length - 1);
        s2 = s2.substring(0, s2.length - 1);
        s3 = s3.substring(0, s3.length - 1);
      } else {
        // If not, delete the rightmost character from the longer strings to try to make them equal.
        if (s1.length > minLen) {
          s1 = s1.substring(0, s1.length - 1);
          operations++;
        }
        if (s2.length > minLen) {
          s2 = s2.substring(0, s2.length - 1);
          operations++;
        }
        if (s3.length > minLen) {
          s3 = s3.substring(0, s3.length - 1);
          operations++;
        }
      }

      // Update minLen to reflect any changes made by trimming the strings.
      minLen = [s1.length, s2.length, s3.length].reduce((a, b) => a < b ? a : b);

      // If at any point, two strings are empty and one is not, or any two strings do not have the possibility of becoming equal, return -1.
      if ((s1.isEmpty || s2.isEmpty || s3.isEmpty) && !(s1.isEmpty && s2.isEmpty && s3.isEmpty)) {
        return -1;
      }
    }

    // If all strings have been reduced to the empty string without returning, they can be made equal with the counted operations.
    return operations;
  }
}
